def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        if isinstance(data, DataFrame):
            data = data.select_dtypes(include=[np.number])
        else:
            data = data.get_numeric_data()

    agg_blocks: List[Block] = []
    agg_items: List[int] = []

    for block in data.blocks:
        values = block.values

        if isinstance(values, IntegerArray):
            values = values.astype(float)

        result, _ = self.grouper.aggregate(values, how, axis=1, min_count=min_count)

        result = maybe_convert_objects(result, try_as_array=False)
        agg_block = make_block(result, placement=block.mgr_locs)
        agg_blocks.append(agg_block)
        agg_items.extend(block.mgr_locs)

    return agg_blocks, data.items.take(agg_items)
